INSERT INTO Products (CreatedDate, Name, Description, ManagementFee, IncomeTax) VALUES (NOW(), 'Fundos de renda fixa', 'Inicialmente, devemos esclarecer que fundos de renda fixa são uma categoria de fundos de investimento. Diferente de outros fundos, estes têm um percentual (80%, em geral) pré-determinado de investimentos em aplicações de renda fixa (títulos do tesouro, CDB pré-fixado, entre outros).', 1.95, 0);
INSERT INTO Products (CreatedDate, Name, Description, ManagementFee, IncomeTax) VALUES (NOW(), 'Fundos de ações', 'Fundos de ações são fundos de investimento que têm como principal fator de risco a variação de preços de ações admitidas à negociação em mercado organizado. Eles são uma forma mais simples de investir na bolsa de valores, já que você não precisa escolher em quais empresas colocar seu dinheiro', 1.3, 0);
INSERT INTO Products (CreatedDate, Name, Description, ManagementFee, IncomeTax) VALUES (NOW(), 'Fundos imobiliários', 'Os Fundos de Investimento Imobiliário (FII) são formados por grupos de investidores com o objetivo de aplicar recursos em diversos tipos de investimentos imobiliários, seja no desenvolvimento de empreendimentos ou em imóveis já prontos, como edifícios comerciais, shopping centers e hospitais.', 1.5, 0);
INSERT INTO Products (CreatedDate, Name, Description, ManagementFee, IncomeTax) VALUES (NOW(), 'Fundos multimercado', 'Um fundo multimercado é uma categoria de fundo de investimento que tem uma política de investimentos determinada a mesclar aplicações de vários mercados, como renda fixa, ações, câmbio, entre outros.', 1.8, 0);
INSERT INTO Products (CreatedDate, Name, Description, ManagementFee, IncomeTax) VALUES (NOW(), 'Fundos cambiais', 'Fundos cambiais são fundos de investimento abertos que investem em ativos atrelados a moedas estrangeiras. De modo geral, eles são indicados para proteger os recursos do investidor contra as flutuações de moedas fortes, como dólar e euro. Mas também podem ser usados para lucrar com a variação positiva da moeda.', 3.0, 0);
INSERT INTO Products (CreatedDate, Name, Description, ManagementFee, IncomeTax) VALUES (NOW(), 'Fundos referenciados', 'Fundo referenciado é um fundo de investimentos cujo objetivo é obter rentabilidade igual a uma taxa de referência (benchmark). Para ser classificado como um fundo referenciado 95% da carteira do fundo deve estar investido em ativos que acompanhem o benchmark definido no regulamento.', 0.95, 0);
INSERT INTO Products (CreatedDate, Name, Description, ManagementFee, IncomeTax) VALUES (NOW(), 'Fundos da dívida externa', 'Tipo de fundo: Dívida Externa. Os fundos de investimento da dívida externa têm por objetivo o investimento de, no mínimo, 80% de seus recursos em títulos representativos da dívida externa de responsabilidade da União negociados no mercado internacional.', 0.8, 0);
